INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','87','鮭魚飯',NULL,'可送餐','鮭魚的營養成分很高，鮭魚的營養價值高，不但含有大量的維生素A，可預防皮膚乾燥及感冒，特有的Omega-3成分還可預防腦部老化，同時可幫助清除人體的三酸甘油脂及多餘的膽固醇，拿來與炒飯搭在一起是個不錯的選擇！');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','120','鰻魚飯',NULL,'可送餐','塗上甜鹹醬汁，以炭火烤的蒲燒，其香味令人食指大動。裹上甜鹹醬汁、香氣四溢的蒲燒，非常下飯。將蒲燒放在白飯上的鰻魚蓋飯或鰻魚飯盒，受到男女老幼喜愛。');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','60','皇帶魚飯',NULL,'可送餐','皇帶魚肉質近似膠質，想補充膠原蛋白嗎? 來一份深海皇帶魚飯吧!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','80','日式拼盤',NULL,'可送餐','餐點內容包括壽司、刺身、清酒、便當、納豆、天婦羅、章魚燒、竹輪、蕎麥麵、牛丼、拉麵、烏龍麵，以及擺設得非常精緻的懷石料理等喔!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','99','港式飲茶',NULL,'可送餐','蝦餃、腸粉、燒賣、鳳爪、叉燒包、糕點，所有您想要的港式茶點都在此道餐點裡喔!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','123','老人健康餐',NULL,'可送餐','用大量蔬菜跟雞胸肉煮成香菇雞炊飯，米粒吸收蔬菜的甜味清爽好吃，蔬菜超多很有飽足感，也適合當減脂餐喔!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','120','超級三寶飯',NULL,'可送餐','港式燒臘真的是愛吃肉的人的福音!，從烤鴨、燒鵝、叉燒、化皮燒肉無一不肉，通通加起來變成三寶飯更是好喔!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','45','蔬食炸天婦羅',NULL,'可送餐','我們精挑青椒、茄子、洋蔥、菇類、四季豆、蘆筍、南瓜、牛蒡和地瓜等蔬食，炸過後顏色也更鮮豔漂亮，讓您同時擁有視覺與味覺的享受!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','30','健康蔬食餐',NULL,'可送餐','我們一貫堅持天然、健康、美味、創意、精緻五大訴求，運用天然蔬果、高纖穀麥、新鮮菇菌與高級食材，力求少油、低鹽，保持天然原味與營養，結合中、日料理與法、義烹調的精髓，設計出獨一無二的素膳佳餚，特別強調美味、創意與精緻。以新鮮青蔬鮮果做主軸，搭配適當的豆製品，採用蒸、燙、燉、煮…等健康烹調方法，呈現蔬果的自然風貌，擺脫傳統素食重油偏鹹的刻板印象!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','100','全素餐',NULL,'可送餐','為最健康、無負擔的餐點，嚴選台灣小農的在地食材、用當季蔬果為你呈現食物的天然美味，讓你吃得安心又開心!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','100','齋戒餐',NULL,'可送餐','因為一整天身體把可消耗掉的能量與脂肪都耗盡了，所以在開齋時除了必須從牛奶中補充鈣質，自雞蛋中取得蛋白質與膽固醇外，還需要補充一些糖類的攝取，這些齋戒餐都為您準備好囉!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','99','泰式料理',NULL,'可送餐','調味料味道較濃厚，時而偏酸，是能在重口味中倘佯的顧客首選!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','89','打拋豬肉飯',NULL,'可送餐','裏頭加了不少辣椒，味道偏重，如果覺得平時吃太少可以參考此道餐點，保證吃到飽飽飽!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','97','打拋牛肉飯',NULL,'可送餐','裏頭加了不少辣椒，味道偏重，如果覺得平時吃太少可以參考此道餐點，保證吃到飽飽飽!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','87','健康老人餐',NULL,'可送餐','用足量蔬菜跟雞胸肉煮成香菇雞炊飯，蔬菜超多很有飽足感，也適合當減脂餐喔!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','807','健康餐',NULL,'可送餐','用適量蔬菜跟雞胸肉煮成香菇雞炊飯，米粒吸收蔬菜的甜味清爽好吃，也適合當減脂餐喔!');
INSERT INTO menu VALUES (to_char(current_date, 'YYYYMMDD')||'-'||lpad(to_char(menu_seq.NEXTVAL), 4, '0'),'CHEF0002','870','超級健康餐',NULL,'可送餐','用大量蔬菜跟雞胸肉煮成香菇雞炊飯，米粒吸收蔬菜的甜味清爽好吃，蔬菜超多很有飽足感，也適合當減脂餐喔!');
